    false,nt"url": null,nt"notes": "The Artillery Impact Area is a training
    area fior the area within the Orchard Training Area Impact Area. It is used by the
    Idaho Army National Guard (IDARNG). This area is the primary target area for artillery.
    Various weapons are discharged in this area. This area contains the bulk of the
    unexploded ordinance found within the larger Impact Area. It contains a live round
    target area. There may be unexploded warheads in this area. There is no public access
    to this area and recreation and grazing are not allowed in this area. This is the
    boundary of the Orchard Training Area Artillery Impact Area in the Morley Nelson
    Snake River Birds of Prey (BOP) National Conservation Area (NCA). This area is within
    the Orchard Training Area Impact Area. This data set is limited to the BOP area.
    This dataset was updated using 2009 NAIP Photography in May 2011 making it current
    to May 2011. Data Attributes include: District Name, Field Office Name, District
    Code, Field Office Code, Area Name and Acres.",nt"license_title": null,nt"extras":
